import React, { useState } from 'react'
import { useDispatch } from 'react-redux'
import { filter } from '../redux/Actions';

function Filter() {
  const dispatch = useDispatch();

  return (
    <div className='FilterDiv'>
      <p className="Filter"> Sort by : </p>
      <button style={{ width: "40px" }} className="Filter" onClick={dispatch(filter(true))}>Done</button>
      <button className="Filter" onClick={dispatch(filter(true))}>Undone</button>
      <button style={{ width: "30px" }} className="Filter" >All</button>
    </div>
  )
}

export default Filter
